import React from "react";
//Context
import PruductsContextProvider from "./context/PruductsContextProvider";
import CartContextProvider from "./context/CartContextProvider";
//Components
import Store from "./components/Store";
import ProductDitails from "./components/ProductDitails";
import { Switch,Route,Redirect } from "react-router-dom";


const App=()=>{
 return(
  <PruductsContextProvider>
    <CartContextProvider></CartContextProvider>
    <Switch>
      <Route path="/products/:id" component={ProductDitails}/>
      <Route path="/products" component={Store}/>
      <Redirect to="/products"/>
    </Switch>
  </PruductsContextProvider>
 )
}
export default App;
